import logo from './logo.svg';
import './Login.css';

import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
Box,
} from "@material-ui/core";

function Login() {
  return (
    <div>
  <Box sx={{ display: 'grid', gridTemplateRows: 'repeat(3, 1fr)' }}>
  <Item>1</Item>
  <Item>2</Item>
  <Item>3</Item>
  </Box>
  </div>
  );
}

export default Login;
